import { useUserStore } from "../../../../../store/3_context";
import ContextQ2Form2 from "./Form2";

const ContextQ2Form = () => {
  const [userList, setUserList] = useUserStore();

  const handleAddUser = (e) => {
    e.preventDefault();
    const newUser = {
      name: e.target.user.value,
      nickName: e.target.nickName.value,
    };
    e.target.user.value = "";
    e.target.nickName.value = "";
    setUserList = [...userList, newUser];
  };
  return (
    <div>
      <h1>Q2Form</h1>
      <input placeholder="name" name="user" />
      <input placeholder="nick-name" nickName="nickName" />
      <button onClick={handleAddUser}>추가</button>
      <ContextQ2Form2 />
    </div>
  );
};
export default ContextQ2Form;
